import React, { useState, useEffect } from 'react';
import { User, Search as SearchIcon, Bell } from 'lucide-react';
import FormCard from './FormCard';
import SearchBar from './SearchBar';
import Sidebar from './AdminSidebar';

const Dashboard = ({ forms, organizationName = "Acme Corp" }) => {
  const [filteredForms, setFilteredForms] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [isAdminSidebarOpen, setIsAdminSidebarOpen] = useState(false);
  const [searchFocused, setSearchFocused] = useState(false);
  const [notifications, setNotifications] = useState(3); // Example notification count

  useEffect(() => {
    setFilteredForms(forms);
    setIsLoading(false);
  }, [forms]);

  const handleSearch = (query) => {
    if (!query) {
      setFilteredForms(forms);
      return;
    }
    const filtered = forms.filter((form) =>
      form.title.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredForms(filtered);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Minimal Header */}
      <header className="bg-white shadow-sm">
        <div className="px-4">
          <div className="flex items-center justify-between h-14">
            {/* Logo Area */}
            <div className="flex items-center space-x-3">
              <div className="w-9 h-9 bg-blue-600 rounded flex items-center justify-center transform transition-all duration-200 hover:scale-105">
                <span className="text-white font-bold text-lg">
                  {organizationName.charAt(0)}
                </span>
              </div>
              <h1 className="text-xl font-semibold text-gray-900 hidden sm:block">
                {organizationName}
              </h1>
            </div>

            {/* Search and Actions */}
            <div className="flex items-center space-x-4">
              <div className={`relative hidden sm:block w-64 transition-all duration-200 ${searchFocused ? 'scale-105' : ''}`}>
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <SearchIcon size={16} className="text-gray-400" />
                </div>
                <input
                  type="text"
                  className="w-full pl-10 pr-4 py-2 text-sm bg-gray-50 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:bg-white transition-all"
                  placeholder="Search forms..."
                  onChange={(e) => handleSearch(e.target.value)}
                  onFocus={() => setSearchFocused(true)}
                  onBlur={() => setSearchFocused(false)}
                />
              </div>
              
              {/* Notifications */}
              <div className="relative">
                <button className="p-2 text-gray-500 hover:text-gray-700 rounded-lg hover:bg-gray-100 transition-all duration-200">
                  <Bell size={20} />
                  {notifications > 0 && (
                    <span className="absolute top-1 right-1 w-4 h-4 bg-red-500 rounded-full text-white text-xs flex items-center justify-center">
                      {notifications}
                    </span>
                  )}
                </button>
              </div>

              {/* Profile */}
              <button
                onClick={() => setIsAdminSidebarOpen(true)}
                className="p-2 text-gray-500 hover:text-gray-700 rounded-lg hover:bg-gray-100 transition-all duration-200"
              >
                <User size={20} />
              </button>
            </div>
          </div>
          
          {/* Mobile Search */}
          <div className="sm:hidden py-2">
            <div className="relative">
              <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                <SearchIcon size={16} className="text-gray-400" />
              </div>
              <input
                type="text"
                className="w-full pl-10 pr-4 py-2 text-sm bg-gray-50 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:bg-white transition-all"
                placeholder="Search forms..."
                onChange={(e) => handleSearch(e.target.value)}
              />
            </div>
          </div>
        </div>
      </header>

      {/* Square Grid Layout */}
      <main className="p-4">
        {isLoading ? (
          <div className="flex justify-center items-center h-32">
            <div className="animate-spin rounded-full h-8 w-8 border-t-2 border-b-2 border-blue-500"></div>
          </div>
        ) : filteredForms.length === 0 ? (
          <div className="text-center py-12">
            <div className="inline-block p-4 rounded-full bg-gray-100 mb-4">
              <SearchIcon size={24} className="text-gray-400" />
            </div>
            <p className="text-gray-500">No forms found</p>
          </div>
        ) : (
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 gap-4">
            {filteredForms.map((form, index) => (
              <div
                key={form.id}
                className="aspect-square transition-all duration-300 hover:-translate-y-1 hover:shadow-lg"
                style={{
                  animationDelay: `${index * 50}ms`,
                }}
              >
                <div className="bg-white w-full h-full rounded-lg shadow-sm border border-gray-100 p-4 flex flex-col">
                  <div className="flex-1">
                    <h3 className="font-medium text-gray-900 mb-2 line-clamp-2">
                      {form.title}
                    </h3>
                    <p className="text-sm text-gray-500 line-clamp-3">
                      {form.description}
                    </p>
                  </div>
                  <div className="mt-4 pt-4 border-t border-gray-100">
                    <div className="flex items-center justify-between text-sm">
                      <span className="text-gray-500">Responses</span>
                      <span className="font-medium text-gray-900">{form.responses || 0}</span>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </main>

      <Sidebar
        isOpen={isAdminSidebarOpen}
        onClose={() => setIsAdminSidebarOpen(false)}
      />
    </div>
  );
};

export default Dashboard;
